import { StyleSheet, Platform } from 'react-native';

const styles = StyleSheet.create({
    resultBoxContainer:{
        width: Platform.OS === 'ios' || Platform.OS === 'android' ? '90%' : '25%',
        // check elevation
        elevation: 8,
        borderRadius: 10,
        marginBottom: 10,
        height:150,
        borderLeftWidth: 2,
        borderRightWidth: 2,
        borderTopWidth: 2,
        borderBottomWidth: 2,
        borderColor: "black",
        justifyContent: 'center'
    },
    populationText: {
        fontSize: 18,
        textAlign: 'center',
        top: 0
    },
    // TODO: Check names here and in ButtonStyle
    resultText: {
        fontSize: 30,
        textAlign: 'center',

    },
})

export default styles;
